import React from "react";
import "./Payment.css"; // Import CSS

const Payment = () => {
  const handlePayment = () => {
    alert("Redirecting to PhonePe Payment...");
    // Future: Integrate with PhonePe API
  };

  return (
    <div className="payment-container">
      <h2>Payment Page</h2>
      <p>Complete your payment to generate the Health Card.</p>
      <button onClick={handlePayment} className="pay-button">
        Pay Now
      </button>
    </div>
  );
};

export default Payment;
